import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import contact from "./contacts";
import Taoanhtren from "./taoasnav";
import { Taoanhduoi } from "./taoasnav";
function createCardz(contact) {
  return contact.hinh.map(createCardzz)
}
function createCardzz(contact) {
  return (
   <Taoanhtren 
   hinh = {contact}
   />
  )
}

function createCardzzz(contact) {
  return contact.hinh.map(createCardzzzz)
}
function createCardzzzz(contact) {
  return (
   <Taoanhduoi
   hinh = {contact}
   />
  )
}

export default class AsNavFor extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nav1: null,
      nav2: null
    };
  }

  componentDidMount() {
    this.setState({
      nav1: this.slider1,
      nav2: this.slider2
    });
  }

  render() {
    return (
      <div className = "slide">
        <Slider 
          asNavFor={this.state.nav2}
          ref={slider => (this.slider1 = slider)}
        >
         {contact.map(createCardz)}
        </Slider>
        <Slider 
          asNavFor={this.state.nav1}
          ref={slider => (this.slider2 = slider)}
          slidesToShow={3}
          swipeToSlide={true}
          focusOnSelect={true}
        >
          {contact.map(createCardzzz)}
        </Slider>
      </div>
    );
  }
}
